import React from 'react';
import { Parallax, Background } from 'react-parallax';
import { makeStyles } from "@material-ui/core/styles";

import director from 'assets/img/image/directoret.png';
import advisor from 'assets/img/image/rathinamf.png';

const useStyles = makeStyles({

    /* Color Theme Swatches in Hex */
    // .alp-impressions-XXV-1-hex { color: #634C73; }
    // .alp-impressions-XXV-2-hex { color: #59518C; }
    // .alp-impressions-XXV-3-hex { color: #F2A679; }
    // .alp-impressions-XXV-4-hex { color: #D98471; }
    // .alp-impressions-XXV-5-hex { color: #8C544F; }

    '@keyframes mymove': {
        '0%': { marginLeft: '-28vw' },
        '100%': { marginLeft: '100vw' },
    },
    container: {
        marginTop: '-20vh',
        height: '200vh',
        backgroundColor: '#F2A679',
        clipPath: 'polygon(0% 100%, 100% 100%, 100% 13%, 100% 12%, 99% 11%, 99% 11%, 98% 12%,98% 13%, 98% 13%, 97% 11%, 96% 11%, 94% 12%, 94% 12%, 93% 11%, 93% 11%, 91% 10%, 92% 14%, 90% 13%, 86% 10%, 86% 9%, 84% 8%, 83% 8%, 83% 9%, 83% 10%, 82% 10%, 81% 10%, 80% 9%, 79% 9%, 79% 10%, 77% 10%, 77% 10%, 77% 9%, 76% 9%, 74% 8%, 73% 6%, 71% 9%, 70% 6%, 69% 5%, 67% 4%, 66% 3%, 62% 4%, 63% 1%, 62% 2%, 60% 2%, 59% 4%, 59% 3%, 58% 3%, 58% 3%, 57% 2%, 56% 2%, 56% 3%, 55% 4%, 54% 4%, 53% 3%, 53% 3%, 52% 4%, 51% 3%, 51% 3%, 50% 5%, 50% 5%, 49% 6%, 48% 4%, 48% 4%, 48% 3%, 47% 3%, 47% 4%, 47% 4%, 46% 5%, 46% 4%, 45% 3%, 45% 3%, 45% 3%, 44% 3%, 44% 3%, 44% 3%, 44% 5%, 43% 5%, 43% 5%, 43% 4%, 43% 3%, 42% 3%, 42% 3%, 41% 3%, 41% 4%, 41% 4%, 41% 4%, 40% 4%, 40% 4%, 39% 3%, 39% 3%, 38% 3%, 38% 4%, 37% 4%, 37% 5%, 36% 5%, 36% 9%, 36% 7%, 35% 7%, 35% 7%, 33% 6%, 33% 6%, 33% 5%, 33% 5%, 31% 5%, 30% 5%, 30% 5%, 29% 5%, 29% 5%, 29% 6%, 28% 6%, 27% 7%, 27% 6%, 27% 6%, 26% 6%, 24% 8%, 24% 11%, 24% 11%, 23% 10%, 23% 10%, 22% 10%, 22% 9%, 21% 10%, 21% 11%, 20% 12%, 20% 12%, 19% 11%, 19% 11%, 19% 10%, 18% 11%, 17% 11%, 17% 10%, 17% 10%, 17% 10%, 17% 11%, 16% 10%, 16% 10%, 15% 11%, 15% 12%, 14% 11%, 14% 11%, 13% 11%, 13% 10%, 13% 10%, 12% 10%, 12% 11%, 11% 11%, 11% 11%, 11% 12%, 11% 12%, 10% 12%, 9% 11%, 9% 11%, 8% 11%, 8% 11%, 7% 11%, 4% 13%, 6% 13%, 5% 13%, 4% 13%, 4% 14%, 4% 14%, 4% 14%, 3% 14%, 3% 14%, 3% 14%, 2% 15%, 1% 14%, 1% 14%, 1% 14%, 1% 14%, 0% 14%, 0% 15%)',
    },
    Header: {
        position: 'absolute',
        width: '130vw',
        height: '10vh',
        marginTop: '30vh',
        borderTop: '3px solid white',
        borderBottom: '3px solid white',
    },
    title: {
        color: 'white',
        marginLeft: '-28vw',
        animation: '$mymove 10s infinite linear',
    }
});

export default function SectionPatreon(props) {
    const classes = useStyles();

    return (
        <div className={classes.container}>
            <div className={classes.Header}>
                <h1 className={classes.title}>MEET OUR PATREONS</h1>
            </div>
            <Parallax
                blur={{ min: -100, max: 100 }}
                style={{position: 'absolute', overflow: 'visible'}}
                bgImageStyle={{ position: 'absolute',left: '20vw', marginTop: '60vh', height: '60vh', width: '30vw', border:'3px solid #59518C' }}
                bgImage={director}
                strength={300}
            >
                <div style={{height: '130vh', width: '30vw'}}>
                    <h1 style={{position:'absolute',left: '5vw', bottom:'10vh', color:'#634C73', fontWeight: 'bold'}}>Dr. C. Muthamizhchelvan</h1>
                    <h4 style={{position:'absolute',left: '5vw', bottom:'7vh', color:'#634C73', fontWeight: 'bold'}}>DIRECTOR, E&T</h4>
                </div>
            </Parallax>
            <Parallax
                blur={{ min: -100, max: 100 }}
                style={{overflow: 'visible'}}
                bgImageStyle={{ position: 'absolute',left: '60vw', marginTop: '60vh', height: '60vh', width: '30vw', border:'3px solid #59518C' }}
                bgImage={advisor}
                strength={300}
            >
                <div style={{position: 'absolute', height: '130vh', width: '30vw'}}>
                    <h1 style={{position:'absolute',left: '5vw', bottom:'10vh', color:'#634C73', fontWeight: 'bold'}}>Dr. A. Rathinam</h1>
                    <h4 style={{position:'absolute',left: '5vw', bottom:'7vh', color:'#634C73', fontWeight: 'bold'}}>TEAM FACULTY ADVISOR</h4>
                </div>
            </Parallax>
        </div>
    );
};
